import { getEmployees } from "./actions/employees";
import { getToken } from "./actions/token";
import { getTeams } from "./actions/teams";
import Employee from "./components/Employee";
import Alliance from "./components/Alliance";
import Team from "./components/Team";
import * as Api from "./helpers/Api";
import { useDispatch } from "react-redux";
import { HTML5Backend } from "react-dnd-html5-backend";
import { DndProvider } from "react-dnd";
import DragDrop from "./components/DragDrop";
import "./styles/App.css";

function App() {
  const dispatch = useDispatch();

  useEffect(async () => {
    try {
      const token = await dispatch(getToken());
      const employees = await dispatch(getEmployees());
      const teams = await dispatch(getTeams());
    } catch (err) {
      console.log(err);
    }
  }, [dispatch]);
  return (
    <DndProvider backend={HTML5Backend}>
      <div className="App">
        <DragDrop />
        <button
          onClick={() => {
            var axios = require("axios");

            var config = {
              method: "get",
              url: "http://cms.avertra.com/teams",
              headers: {
                Authorization:
                  "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxNTJiNmU1OTExZjZiYzY3MmQzZDZmNSIsImlhdCI6MTYzMjgzOTE1MCwiZXhwIjoxNjM1NDMxMTUwfQ.XEAwacR7yXCLA01xqXdnxTYuGWbEXGaICpUwrg2uZcE",
              },
            };

            axios(config)
              .then(function (response) {
                console.log(JSON.stringify(response.data));
                response.data.map((e) => {
                  var config = {
                    method: "delete",
                    url: `http://cms.avertra.com/teams/{e.id}`,
                    headers: {
                      Authorization:
                        "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxNTJiNmU1OTExZjZiYzY3MmQzZDZmNSIsImlhdCI6MTYzMjgzOTE1MCwiZXhwIjoxNjM1NDMxMTUwfQ.XEAwacR7yXCLA01xqXdnxTYuGWbEXGaICpUwrg2uZcE",
                    },
                  };

                  axios(config)
                    .then(function (response) {
                      console.log(JSON.stringify(response.data));
                    })
                    .catch(function (error) {
                      console.log(error);
                    });
                });
              })
              .catch(function (error) {
                console.log(error);
              });
          }}
        >
          {" "}
        </button>
      </div>
    </DndProvider>
  );
}

export default App;
